import getLocationHierarchy from "./getLocationHierarchy"
import renderIndexMenu from './renderIndexMenu';
import ListItem from "./listItem"

export default function ItemList(props) {
  let container = []

  if (!props.type['highlighted'] && !props.data['display']['nonehighlighted']) {
    return <div></div>
  }

  for (let i = 0; i < props.page; i++) {
    if (!props.item[i]) break
    container.push(props.item[i])
  }

  const renderList = () => {
    return container.map((item, i) => (
      <a 
        target="blank" 
        href={getLocationHierarchy(item[0].data, props.profile)} 
        style={{textDecoration: "none", color: "inherit"}}
      >
        <ListItem 
          key={`${props.type}${i}D`} 
          item1={item[0].data} 
          item2={item[1].data} 
          item3={item[2].data} 
          item4={item[3].data} 
          item5={item[4].data} 
          item6={item[5].data}
        />
      </a>
    ))
  }

  if (props.type) {
    return (
      <div>
        {renderIndexMenu(props.data, props.item, props.filteredSearch, props.profile)}
        {renderList()}
      </div>
    )
  }
}
